$.aoe=["A Stopwatch is timepiece design to measure the amount of time that elapses between its activation and deactivation. Create simple stopwatch watch app, in this app we can store start, stop, and reset functionality. User start the watch,store stop timing user reset the app and time are erased","A contact manager is software program that enables users to easily store and find contact information,such as name,addresses and telephone numbers. User can Login and register the app add contact details like name,contact number, email address, designation and other data. its simple create ,read updateand delete operation are performed in the project","In this application I have design time tracking system based on course and their fees structure user can add course and fees of that course, read all courses edit and delete course, make simple CRUD opeartion in that, user can Login using Email, Anonymous, username-password, google and facebook login using firebase.","This app combinesa very slick UI with custom animations to create a unique user experience. Custome animations are greate. but real apps are made of more than just UI. So we will also learn about app architecture, local data persistence, state managment and how to write maintainable code","I have built this app for Daily Expenses in thus app I have create two dashboard like Room dashboard and Personal Dashboard. In room dashboard we add/put the expenses like milk,butter,vegetables,etc. When we add the datain this app put the item name, price and submit it successfully.Data added in room dashboard and display total amount of all items for current month in room Dashboard as well as which user added this item and their name and current timestamp also.\nIn Personal Dashboardwe put add data in app add item name and price of that item and by default put the curent timestamp. When we add the item in personalDashboard then calculate total amount of current month.\nWe will select the expenses data list by month for both room and personal dashboard Select the month and get data from database of selected month data and total amount alsosame as personal dashboard also, get the user information of the logged in user and logged out the app.","Create E-commerce shopping app. in this app I have design online mobile and laptopselling app. see all list of data select data of the perticuler item. add item to cart, remove item from cart. display all cart item total amount.when we removeitem from cart total amount also decresed.","Create simple CRUD operations using Firebase, In this project perform allCreate, Read, Update, Delete operaions. When operations is success then displayperticuler snackbar with message. display all data from database."]
